pragma solidity 0.8.14;
import "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableMapUpgradeable.sol";

interface IGovernorINN {
    /**
     * @dev Enum type of votes
     */
    enum VoteType {
        NONE,
        AGAINST,
        FOR,
        ABSTAIN
    }

    /**
     * @dev Enum type of proposals
     */
    enum ProposalType {
        NONE,
        VALIDATOR,
        INVESTMENT,
        GOVERNANCE
    }

    /**
     * @dev Enum type of actions
     */
    enum ActionType {
        NONE,
        NEW,
        EXIT,
        FREEZE,
        UNFREEZE
    }

    /**
     * @dev Enum state of consensus proposal
     */
    enum ProposalState {
        NONE,
        PENDING, //
        ACTIVE,
        CANCELED,
        DEFEATED, // < 51
        SUCCEEDED, //51 >
        EXPIRED,
        EXECUTED
    }

    /**
     * @dev Struct request for proposal creation
     */
    struct ProposalRequest {
        bytes32 offchainID;
        ProposalType proposalType;
        ActionType actionType;
        string description;
        bytes data;
    }

    /**
     * @dev Struct New Validator Proposal
     */
    struct NewValidatorProposal {
        string validatorName;
        address validatorEOA;
    }

    /**
     * @dev Struct New Investment Proposal
     */
    struct NewInvestmentProposal {
        string startupName;
        uint256 tokenOffer;
        address startupEOA;
        uint16 sharedStake;
    }

    /**
